import React from 'react';
import styled from 'styled-components';
import { HomeTopbannerDummydata } from 'utils/mockData';
import TopBanner from '../../components/common/TopBanner';

function HomePage() {
	return (
		<ComponentsWrapper>
			<TopBanner data={HomeTopbannerDummydata} />
			<div className="section">asd</div>
		</ComponentsWrapper>
	);
}

const ComponentsWrapper = styled.div`
	padding-top: 25px;

	.section {
		position: relative;
		scroll-margin-top: 4px;
		padding: 60px 0;
	}
`;

export default HomePage;
